INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (5, '2016-03-29 21:25:03', 'Спасибо конечно, но я не совсем понял самого механизма (что, как, куда подключается). Данный пример - это как часть большой формулы. Я так понимаю, что мне нужно копать полные мануалы\\статьи по данному вопросу? Как правильно гуглить этот вопрос: "Подключаемые модули", "...." ? А то я с подобных примеров только общие моменты уловил, ><', 5, 4);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (6, '2016-03-29 21:25:13', 'Я могу сделать например при помощи рефлексии такую штуку: Например. Сначала проанализировать какой "шаблон выбрать" в настройках, а потом в зависимости от этого создать newInstance() класса по текстовой ссылке переведенной Object m = Class.forName(s).newlnstance(); Для рабочих классов шаблона. Смогу ли я например из скомпилированного jar-ника программы, использовать java\\class\\jar файлы шаблонов в внешней папки? Тобишь - программа устанавливается, создает папку для модулей, туда закачиваются вручную плагины - классы, а потом программа использует их из внешеней папки?', 5, 5);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (7, '2016-03-29 21:25:24', 'этот кусок программы ищет все файлы с расширением groovy, загружает, прогоняет через scriptmanager и результат проверяет на принадлежность к интерфейсу и вставляет в список плагинов.  . groovy это ява в роли скриптового языка и с мешком синтактического сахара. то-есть код на яве 100% рабочий код на groovy. . я вот что подумал: раз тебе нужна одна программа для разных вещей, то эти вещи не могут быть настолько разными. может тебе стоит попробовать adapter pattern?', 5, 6);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (8, '2016-03-29 21:28:54', '    import java.io.BufferedInputStream;     import java.io.BufferedOutputStream;     import java.io.BufferedReader;     import java.io.File;     import java.io.FileInputStream;     import java.io.FileOutputStream;     import java.io.FileReader;     import java.io.IOException;     import java.io.InputStream;     import java.io.OutputStream;     import java.net.InetAddress;     import java.net.ServerSocket;     import java.net.Socket;     import java.net.UnknownHostException;           public class Client {                  public static void main(String[] args) throws UnknownHostException, IOException {                   int filesize = 1022386;             int bytesRead;             int currentTot;                          String FILE_NAME = "files/file1.txt";                  //        ServerSocket s = new ServerSocket(0);     //        int port = s.getLocalPort();                          Socket socket = new Socket(InetAddress.getLocalHost(), 15123);             System.out.println("Accepted connection : " + socket);                          byte[] bytearray = new byte[filesize];             InputStream is = socket.getInputStream();             File copyFileName = new File(FILE_NAME);             FileOutputStream fos = new FileOutputStream(copyFileName);             BufferedOutputStream bos = new BufferedOutputStream(fos);             bytesRead = is.read(bytearray, 0, bytearray.length);             currentTot = bytesRead;                   do {                 bytesRead = is.read(bytearray, currentTot, (bytearray.length - currentTot));                 if (bytesRead >= 0) {                     currentTot += bytesRead;                 }             } while (bytesRead > -1);                   bos.write(bytearray, 0, currentTot);                   bos.flush();             bos.close();             socket.close();                      }     }', 8, 4);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (9, '2016-03-29 21:30:04', 'Поддерживаю вопрос', 10, 3);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (10, '2016-03-29 21:30:15', 'Позабыл, что писал вопрос. Напишу, свой результат, вдруг кому-то будет полезным. В своем случае реализовал с использованием spring-websocket. В бине-handler''e websocket запросов храню список открытых websocket-сессий по пользователям. Сессию добавляю в afterConnectionEstablished(), удаляю в afterConnectionClosed().  В случае, когда нужно клиенту отправлять информацию об изменениях, выполняю session.sendMessage(...) Совместимость с версиями браузеров, не поддерживающих websocket, выполнена с помощью SockJS. ', 10, 5);
