INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (12, '2016-03-29 21:59:01', 'JQuery ни при чем, что сервер отдал (у Вас, кстати, кириллицу в данном примере сервер не отдает), то на клиент и пришло. А JQuery просто на страницу "впихнул". Надо смотреть, чтобы кодировка на сервере отдавалась та же, что используется на клиенте. Посмотрите, например, в браузере в DevTools (или ему подобным), что вообще приходит от сервера. Проверьте кодировку на клиенте. В общем, пока все-равно не ясна конкретно суть проблемы.', 19, 3);
INSERT INTO forumdb.comments (id, publicationDate, text, message_id, user_id) VALUES (13, '2016-03-29 22:03:09', 'По-идее он должен изменять координаты отрисовки квадратика по нажатию на пробел. но ничего не происходит...  что я сделал не так? Помогите.', 20, 5);
